package com.LoopsStatement;

public class NestedLoop1 
{

	public static void main(String[] args) 
	{
		for(int i=10;i>=5;i--)
	     {
	    	 for(int k=20;k>i;k--)
	    	 {
	    		 System.out.println(k);
	    	 }
	     }
		System.out.println("********");
		
		// TODO Auto-generated method stub

	}

}
